import React from 'react';
import { FaUserLarge, FaThumbsUp, FaShare } from 'react-icons/fa';
import { MdDynamicFeed } from 'react-icons/md';
import { IoLogOut, IoIosThumbsUp, IoShareSocial } from 'react-icons/io';
import { TiThumbsUp, TiSocialShare } from 'react-icons/ti';
import '../styles/Postagem.css'; // Importe o arquivo CSS diretamente

function Postagem() {
    return (
        <div>
            {/* Primeira postagem */}
            <div className="postagem">
                <div className="informacoes">
                    <div className="usuario">
                        <div className="miniaturaperfil">
                            <img src="img/avatar.jpg" alt="" />
                        </div>
                        <p className="nome-do-usuario">Felipi Amorim</p>
                    </div>
                    <IoLogOut className="opcoes" /> {/* Ícone de logout */}
                </div>
                <img src="img/HD-wallpaper-reddeadredemption2-games-gta-online-rdr2-red-dead-redemption-2-rockstar-xbox.jpg" alt="" className="capa-post" />
                <div className="conteudo-da-postagem">
                    <div className="reacoes-icones">
                        <FaThumbsUp className="icon" /> {/* Ícone de curtir do Font Awesome */}
                        <IoIosThumbsUp className="icon" /> {/* Ícone de curtir do Ionicons */}
                        <TiThumbsUp className="icon" /> {/* Ícone de curtir do Typicons */}
                        <FaShare className="icon" /> {/* Ícone de compartilhar do Font Awesome */}
                        <IoShareSocial className="icon" /> {/* Ícone de compartilhar do Ionicons */}
                        <TiSocialShare className="icon" /> {/* Ícone de compartilhar do Typicons */}
                    </div>
                    <p className="curtidas">10.000 curtidas</p>
                    <p className="descricao">
                        <span className="span">Usuario</span>
                        Lorem ipsum, dolor sit amet consectetur adipisicing elit. Adipisci, sint aut optio deserunt
                        amet provident eum ullam? Debitis laborum, amet ipsa nesciunt mollitia reiciendis rerum
                        fugiat quia facilis exercitationem libero?
                    </p>
                    <p className="tempo-post">7 minutos</p>
                </div>
                <div className="comentario-postagem">
                    <input type="text" className="comentario-msg" name="msg" placeholder="Comentar Postagem" />
                    <button className="comentario-btn" type="submit">Postar</button>
                </div>
            </div>

            {/* Segunda postagem */}
            <div className="postagem">
                <div className="informacoes">
                    <div className="usuario">
                        <div className="miniaturaperfil">
                            <img src="img/avatar2.jpg" alt="" />
                        </div>
                        <p className="nome-do-usuario">Outro Usuário</p>
                    </div>
                    <IoLogOut className="opcoes" /> {/* Ícone de logout */}
                </div>
                <img src="img/postagem2.jpg" alt="" className="capa-post" />
                <div className="conteudo-da-postagem">
                    <div className="reacoes-icones">
                        <FaThumbsUp className="icon" /> {/* Ícone de curtir do Font Awesome */}
                        <IoIosThumbsUp className="icon" /> {/* Ícone de curtir do Ionicons */}
                        <TiThumbsUp className="icon" /> {/* Ícone de curtir do Typicons */}
                        <FaShare className="icon" /> {/* Ícone de compartilhar do Font Awesome */}
                        <IoShareSocial className="icon" /> {/* Ícone de compartilhar do Ionicons */}
                        <TiSocialShare className="icon" /> {/* Ícone de compartilhar do Typicons */}
                    </div>
                    <p className="curtidas">5.000 curtidas</p>
                    <p className="descricao">
                        <span className="span">Outro Usuário</span>
                        Segunda postagem com conteúdo diferente.
                    </p>
                    <p className="tempo-post">15 minutos</p>
                </div>
                <div className="comentario-postagem">
                    <input type="text" className="comentario-msg" name="msg" placeholder="Comentar Postagem" />
                    <button className="comentario-btn" type="submit">Postar</button>
                </div>
            </div>
        </div>
    );
}

export default Postagem;
